import React from 'react';

class Home extends React.Component {
  render() {
    const containerStyle = {
      position: 'fixed',
      top: 0,
      left: 0,
      width: '100vw',
      height: '100vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#000',
    };

    const imageSrc = 'https://d3qyu496o2hwvq.cloudfront.net/wp-content/uploads/2022/08/DDP_2445-565x475.jpg';

    return (
      <div className="container" style={containerStyle}>
        <img src={imageSrc} alt="Snow" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
        <div className="centered">Centered</div>
      </div>
    );
  }
}

export default Home;
